INSERT INTO `tbl_catalog` (`id`, `name`, `content`, `parent_id`, `position`, `is_view`, `url`, `seo_title`, `seo_description`, `seo_keywords`) VALUES
(4, 'test', '', -1, 0, 0, '', 'test', '', ''),
(5, 'Organic mineral driven pigment', '<p>Organic mineral driven pigment</p>\r\n', -1, 1000, 1, 'organic-mineral-driven-pigment', 'Organic mineral driven pigment', 'Organic mineral driven pigment ', ''),
(6, 'OPM Certification WorkShops', '<p>BEGIN OR REVITIALIZE&nbsp;YOUR CAREER AS A PERMANENT MAKEUP TECHNICIAN by attending a 10 Hour course with OPM creator and founder, Lorine Mikhaeil. The course covers the OPM System and difference, stretching techniques,&nbsp;how to use the OPM machine&nbsp;and formulate the pigments, in-depth client consultation, practice on skins and model workshops on live models. &nbsp;</p>\r\n\r\n<p>The OPM&reg; WorkShop: A mandatory introduction to the world of organic permanent make up, this is our best and most informative workshop ever. &nbsp;The workshop is a rapid and intense course of study, and an efficient way of learning all about Lorine&rsquo;s patented OPM&reg; Organic Permanent Makeup technique. This course will be available after each trade show event.</p>\r\n\r\n<p>To see a list of Trade Show locations please&nbsp;click here.&nbsp;</p>\r\n\r\n<p>For a detailed OPM&reg; WorkShop Curriculum, pleaseclick here.</p>\r\n', -1, 1001, 1, 'opm-certification-workshops', 'OPM Certification WorkShops', 'BEGIN OR REVITIALIZE YOUR CAREER AS A PERMANENT MAKEUP TECHNICIAN by attending a 10 Hour course with OPM creator and founder, Lorine Mikhaeil. The course covers the OPM System and difference, stretching techniques, how to use the OPM machine and formulate the pigments, in-depth client consultation, practice on skins and model workshops on live models.   The OPM® WorkShop: A mandatory introduction to the world of organic permanent make up, this is our best and most informative workshop ever.  The workshop is a rapid and intense course of study, and an efficient way of learning all about Lorine’s patented OPM® Organic Permanent Makeup technique. This course will be available after each trade show event. To see a list of Trade Show locations please click here.  For a detailed OPM® WorkShop Curriculum, pleaseclick here. ', ''),
(7, 'OPM® Anesthetic Cream', '<p>OPM&reg; Anesthetic Cream</p>\r\n', -1, 1003, 1, 'opm-anesthetic-cream', 'OPM® Anesthetic Cream', 'OPM® Anesthetic Cream ', ''),
(8, 'OPM® ERASER', '<p>OPM&reg; ERASER</p>\r\n', -1, 1004, 1, 'opm-eraser', 'OPM® ERASER', 'OPM® ERASER ', ''),
(9, 'OPM® MACHINES', '<p>OPM&reg; MACHINES</p>\r\n', -1, 1005, 1, 'opm-machines', 'OPM® MACHINES', 'OPM® MACHINES ', ''),
(10, 'Office Products - not for online sales', '<p>Office Products - not for online sales</p>\r\n', -1, 11001, 0, 'office-productsnot-for-online-sales', 'Office Products - not for online sales', 'Office Products - not for online sales ', '');
INSERT INTO `tbl_content` (`id`, `name`, `content`, `url`, `seo_title`, `seo_description`, `seo_keywords`) VALUES
(1, ' Why OPM® Organic Permanent Makeup is The Best in Los Angeles? ', '<p><span style="font-size:16px">Our exclusive OPM&reg; Organic Permanent Makeup system uses state of the art equipment, the highest quality&nbsp;Derma Blush&reg;&nbsp;organic pigments, and exquisite artistry.&nbsp;The results are safer and&nbsp;more natural than conventional permanent makeup.&nbsp;Schedule an appointment or call us for a free consultation. We guarantee 100% customer satisfaction.</span></p>\r\n\r\n<p><strong>Sign up now to receive a FREE GIFT.</strong></p>\r\n\r\n<p><a class="btn" href="/site/quick/1">RECEIVE A GIFT</a></p>\r\n\r\n<div class="g-clear_fix">\r\n<hr /></div>\r\n\r\n<div class="row">\r\n<div class="col-xs-12 col-sm-6 col-md-6">\r\n<h2>SERVICES</h2>\r\n\r\n<p><span style="font-size:16px">Try the OPM difference. We provide the best of </span><span style="font-size:14px"><span style="font-size:16px"><gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="38762fd4-7424-4d0f-84fb-2540090bb56e" id="a2dd03bf-3e3f-428f-8d50-57d43e684f48">medi</gs></span></span><span style="font-size:16px">-spa services, as well as organic permanent make-up.</span></p>\r\n\r\n<p><span style="font-size:16px">We are so convinced you&rsquo;ll love us, we offer special prices for all first time clients; as well as, current client discounts.INSERT INTO `tbl_email_message` (`id`, `name`, `subject`, `message`, `email_key`, `comment`, `email_type`, `header`, `footer`, `success_message`, `failed_message`) VALUES
(1, 'OS', 'Message{SUBJECT}', '', 'contact_form', '', 1, 1, 1, '', ''),
(2, 'Confirm registration', 'Confirm registration', '<p>Your registration has been successfully completed!</p>\r\n\r\n<p><strong>You login:</strong> {LOGIN}</p>\r\n\r\n<p><strong>Your password:</strong> {PASSWORD}</p>\r\n\r\n<p>To confirm an email address, please click here.</p>\r\n\r\n<p>{ACTIVATION_URL}</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'registration', '', 2, 1, 1, 'Thank you for your registration. Please check your email.', 'Upon registration error occurred. Please re-register or contact us.'),
(3, 'Password Recovery', 'Request for password recovery', '<p>To reset the password, use the link:<br />\r\n{PASSWORD_RECOVERY}</p>\r\n', 'password_recovery', '', 2, 1, 1, 'Please check your email. An instructions was sent to your email address.', ''),
(4, 'Video user access', 'OPM video access', '<p>Hellow, {NAME}!</p>\r\n\r\n<p>Your link to access for video :</p>\r\n\r\n<p>{LINK}</p>\r\n\r\n<p>Enjoy!</p>\r\n', 'video_user_access', '', 2, 1, 1, '', ''),
(5, 'Admin message for video', 'User {NAME} get video', '<p>Hi! User {NAME} get video courses.</p>\r\n\r\n<p>Invoice: {LINK}</p>\r\n', 'video_admin_message', '', 1, 1, 1, '', ''),
(6, 'Quick Registration - RECEIVE A GIFT', 'RECEIVE A GIFT', '<p>Hello,</p>\r\n\r\n<p>Thank you for choosing our exclusive OPM&reg; Organic Permanent Makeup.</p>\r\n\r\n<p>Your FREE GIFT code is FREE739</p>\r\n\r\n<p>Please, contact our office by the phone (310) 471-7777, and we will assist you how to get your FREE GIFT.</p>\r\n\r\n<p>Thank once again.</p>\r\n\r\n<p>We are looking forward to hear from you.</p>\r\n\r\n<p>OPM&reg; Organic Permanent Makeup</p>\r\n', 'registration_get_gift', '', 2, 1, 1, '', ''),
(7, 'Quick Registration - FREE RETOUCH', 'FREE RETOUCH', '<p>Hello,</p>\r\n\r\n<p>Thank you for choosing our exclusive OPM&reg; Organic Permanent Makeup.</p>\r\n\r\n<p>Your FREE GIFT retouch code is FREE-RETOUCH-319</p>\r\n\r\n<p>Please, contact our office by the phone (310) 471-7777, and we will assist you how to get your FREE GIFT.</p>\r\n\r\n<p>Thank once again.</p>\r\n\r\n<p>We are looking forward to hear from you.</p>\r\n', 'registration_free_retouch', '', 2, 1, 1, '', ''),
(8, 'Quick Registration - TRAINING COURSE', 'TRAINING COURSE', '<p>Hello,</p>\r\n\r\n<p>Thank you for choosing our exclusive OPM&reg; Organic Permanent Makeup.</p>\r\n\r\n<p>To get your FREE VIDEO, please, use the link below:</p>\r\n\r\n<p>www.OPMakeup.com/video/150gift</p>\r\n\r\n<p>For more video tutorials, please, use the link below:</p>\r\n\r\n<p><a href="http://opmakeup/video" target="_blank">www.OPMakeup.com/video</a></p>\r\n\r\n<p>Thank once again.</p>\r\n\r\n<p>We are looking forward to hear from you.</p>\r\n\r\n<p>https://www.youtube.com/watch?v=8NVVjZzPAv8</p>\r\n', 'registration_training_course', '', 2, 1, 1, '', ''),
(9, 'User Service calendar registration confirm', 'Service registration confirm', '<p>Hellow, {NAME}!</p>\r\n\r\n<p>You successfully registered on service: {SERVICE_NAME}</p>\r\n\r\n<p>Additional service information can be found there:</p>\r\n\r\n<p>{LINK}</p>\r\n\r\n<p>Your visit date is {VISIT_DATE}</p>\r\n', 'calendar_event', '', 2, 1, 1, 'Thank your for registration! We will contact you as soon as possible!', ''),
(10, 'New Service Registration For Admin', 'New Service Registration', '<p>Hellow!</p>\r\n\r\n<p>User {USER_LINK} registered on service: {SERVICE_NAME}</p>\r\n\r\n<p>View service: {LINK}</p>\r\n', 'admin_calendar_event', '', 1, 1, 1, '', '');
