INSERT INTO `tbl_product` (`id`, `name`, `description`, `content`, `articul`, `price`, `share_price`, `ext`, `date`, `position`, `is_view`, `popular`, `is_new`, `stock`, `status`, `url`, `seo_title`, `seo_description`, `seo_keywords`) VALUES
(2, 'OPM-1 IVORY WHITE', 'Organic mineral driven pigment for specific undertone skin type. Ivory White for Skin type 1 Eyebrow color.', '<p>Organic mineral driven pigment for specific undertone skin type. Ivory White for Skin type 1 Eyebrow color.</p>\r\n\r\n<p><strong>EYELINER Colors</strong>.&nbsp; Select color based on client consultation.&nbsp; OPM has four colors to select from:</p>\r\n\r\n<ul>\r\n	<li>Black (OPM 12)</li>\r\n	<li>Espresso (OPM 8)</li>\r\n	<li>Jade &nbsp;(OPM 6) &ndash; blue and green eyes</li>\r\n	<li>Aqua Teal (OPM 7) - blue and green eyes&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>CONSULTATION</strong>:&nbsp; We recommend doing an in-depth client consultation prior to any permanent makeup services.&nbsp;&nbsp; OPM PIGMENTS are formulated based on the Fitzpatrick Skin Type.&nbsp;&nbsp; A Fitzpatrick Skin Type test is recommended to give your client prior to procedure.&nbsp; Skin type I-IV&nbsp; skin type I is the lighter and IV is the darkest. OPM 1 is for skin type 1, OPM 2 is for skin type 2, etc.</p>\r\n\r\n<p><strong>APPLICATION</strong>:&nbsp; OPM pigments are concentrated water based pigments and go in easily with gentle penetration in the skin.</p>\r\n', 'OPM-1', 75, 0, 'шт', '2014-09-26', 1000, 1, 0, 0, 0, 1, 'opm-1-ivory-white', 'OPM-1 IVORY WHITE', 'Organic mineral driven pigment', ''),
(5, 'OPM-10 NUDE', 'Organic mineral driven pigment for specific undertone skin type. Nude for Skin type 1-5 lip color.', '<p>Organic mineral driven pigment for specific undertone skin type. Nude for Skin type 1-5 lip color.</p>\r\n\r\n<p>LIP Colors &ndash; select color based on client consultation. &nbsp;OPM has four lip colors. Possibilities are endless as colors can be intermixed to create a unique shade for each of your clients.</p>\r\n\r\n<p>Rose (OPM 9) &ndash; natural rose tint<br />\r\nNude Beige (OPM 10) - most popular for a natural look<br />\r\nRed (OPM 11) &ndash; never use red alone, use to darken other shades<br />\r\nChili (OPM 13) &ndash; very nice hot red; but not a natural look</p>\r\n\r\n<p>CONSULTATION:&nbsp; We recommend doing an in-depth client consultation prior to any permanent makeup services.&nbsp;&nbsp; OPM PIGMENTS are formulated based on the Fitzpatrick Skin Type.&nbsp;&nbsp; A Fitzpatrick Skin Type test is recommended to give your client prior to procedure.&nbsp; Skin type I-IV&nbsp; skin type I is the lighter and IV is the darkest. OPM 1 is for skin type 1, OPM 2 is for skin type 2, etc.&nbsp;</p>\r\n\r\n<p>APPLICATION:&nbsp; OPM pigments are concentrated water based pigments and go in easily with gentle penetration in the skin. &nbsp; &nbsp;</p>\r\n\r\n<p>MACHINE preference: recommend utilizing the OPM Machine or a digital machine, which has less of a vibration. The OPM Machine is a digital machine using a magnet in the motor resulting in no vibration on the tip of the needle.&nbsp; With no vibration in the tip of the needle, there is considerably less or no bleeding (depending on skin).&nbsp;</p>\r\n', 'OPM-10', 75, 0, 'шт', '2014-09-26', 1010, 1, 0, 0, 0, 1, 'opm-10-nude', 'OPM-10 NUDE', 'Organic mineral driven pigment for specific undertone skin type. Nude for Skin type 1-5 lip color. LIP Colors – select color based on client consultation.  OPM has four lip colors. Possibilities are endless as colors can be intermixed to create a unique shade for each of your clients. Rose (OPM 9) – natural rose tint Nude Beige (OPM 10) - most popular for a natural look Red (OPM 11) – never use red alone, use to darken other shades Chili (OPM 13) – very nice hot red; but not a natural look CONSULTATION:  We recommend doing an in-depth client consultation prior to any permanent makeup services.   OPM PIGMENTS are formulated based on the Fitzpatrick Skin Type.   A Fitzpatrick Skin Type test is recommended to give your client prior to procedure.  Skin type I-IV  skin type I is the lighter and IV is the darkest. OPM 1 is for skin type 1, OPM 2 is for skin type 2, etc.  APPLICATION:  OPM pigments are concentrated water based pigments and go in easily with gentle penetration in the skin.     MACHINE preference: recommend utilizing the OPM Machine or a digital machine, which has less of a vibration. The OPM Machine is a digital machine using a magnet in the motor resulting in no vibration on the tip of the needle.  With no vibration in the tip of the needle, there is considerably less or no bleeding (depending on skin).  ', ''),
(7, 'OPM Certification WorkShop (60 hours online + 3 days hands-on training)', 'BEGIN OR REVITIALIZE YOUR CAREER AS A PERMANENT MAKEUP TECHNICIAN by attending a 100 Hour hybrid course with OPM creator and founder, Lorine Mikhaeil.', '<p>BEGIN OR REVITALIZE&nbsp;YOUR CAREER AS A PERMANENT MAKEUP TECHNICIAN by completing a 60 hour online course + three days hands-on training with OPM creator and founder, Lorine Mikhaeil.</p>\r\n\r\n<p>The course covers</p>\r\n\r\n<ul>\r\n	<li>The OPM System and difference</li>\r\n	<li>Stretching techniques</li>\r\n	<li>How to use the OPM machine&nbsp;and formulate the pigments</li>\r\n	<li>Drawing technique</li>\r\n	<li>Perfecting eyebrow shape &amp; design</li>\r\n	<li>In-depth client consultation</li>\r\n	<li>Practice on artificial skins as well as live models</li>\r\n	<li>How to gain clients with sound marketing plans</li>\r\n	<li>How to create portfolios with photos of work samples</li>\r\n	<li>Understanding correction and removal</li>\r\n	<li>Sterilization, sanitation (prep for Bloodborne Pathogens Course)</li>\r\n</ul>\r\n\r\n<p>Also includes</p>\r\n\r\n<ul>\r\n	<li>Your very own OPM digital machine</li>\r\n	<li>OPM 10 Color Selection</li>\r\n	<li>OPM 15 cartridges &amp; needles</li>\r\n	<li>Measuring Tool</li>\r\n	<li>White pen</li>\r\n	<li>Five practice skins</li>\r\n	<li>Downloadable videos for online instruction</li>\r\n</ul>\r\n\r\n<p>The OPM&reg; WorkShop: A mandatory introduction to the world of organic permanent make up, this is our best and most informative workshop ever. &nbsp;The workshop is a rapid and intense course of study, and an efficient way of learning all about Lorine&rsquo;s patented OPM&reg; Organic Permanent Makeup technique. This course will be available after each trade show event.</p>\r\n\r\n<p>To see a list of Trade Show locations please&nbsp;click here.&nbsp;</p>\r\n\r\n<p>For a detailed OPM&reg; WorkShop Curriculum, please click here.</p>\r\n', 'OPM WorkShop (60 hours online + 3 days hands-on training)', 5500, 0, 'шт', '2014-09-26', 901, 1, 0, 0, 0, 1, 'opm-certification-workshop', 'OPM Certification WorkShop', 'BEGIN OR REVITIALIZE YOUR CAREER AS A PERMANENT MAKEUP TECHNICIAN by attending a 10 Hour course with OPM creator and founder, Lorine Mikhaeil. The course covers the OPM System and difference, stretching techniques, how to use the OPM machine and formulate the pigments, in-depth client consultation, practice on skins and model workshops on live models. The OPM® WorkShop: A mandatory introduction to the world of organic permanent make up, this is our best and most informative workshop ever.  The workshop is a rapid and intense course of study, and an efficient way of learning all about Lorine’s patented OPM® Organic Permanent Makeup technique. This course will be available after each trade show event. To see a list of Trade Show locations please click here.  For a detailed OPM® WorkShop Curriculum, pleaseclick here. ', ''),
