(16, 'OPM-5 DARK BROWN', 'Organic mineral driven pigment for specific undertone skintype. Dark Brown for Skin type 5 Eyebrow color.', '<p>Organic mineral driven pigment for specific undertone skintype. Dark Brown for Skin type 5 Eyebrow color.</p>\r\n\r\n<p>EYELINER Colors.&nbsp; Select color based on client consultation.&nbsp; OPM has four colors to select from:</p>\r\n\r\n<p>Black (OPM 12)<br />\r\nEspresso (OPM 8)<br />\r\nJade &nbsp;(OPM 6) &ndash; blue and green eyes<br />\r\nAqua Teal (OPM 7) - blue and green eyes&nbsp;</p>\r\n\r\n<p>CONSULTATION:&nbsp; We recommend doing an in-depth client consultation prior to any permanent makeup services.&nbsp;&nbsp; OPM PIGMENTS are formulated based on the Fitzpatrick Skin Type.&nbsp;&nbsp; A Fitzpatrick Skin Type test is recommended to give your client prior to procedure.&nbsp; Skin type I-IV&nbsp; skin type I is the lighter and IV is the darkest. OPM 1 is for skin type 1, OPM 2 is for skin type 2, etc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>APPLICATION:&nbsp; OPM pigments are concentrated water based pigments and go in easily with gentle penetration in the skin.</p>\r\n', 'OPM-5', 75, 0, 'шт', '2014-09-26', 1005, 1, 0, 0, 0, 1, 'opm-5-dark-brown', 'OPM-5 DARK BROWN', 'Organic mineral driven pigment for specific undertone skintype. Dark Brown for Skin type 5 Eyebrow color. EYELINER Colors.  Select color based on client consultation.  OPM has four colors to select from: Black (OPM 12) Espresso (OPM 8) Jade  (OPM 6) – blue and green eyes Aqua Teal (OPM 7) - blue and green eyes  CONSULTATION:  We recommend doing an in-depth client consultation prior to any permanent makeup services.   OPM PIGMENTS are formulated based on the Fitzpatrick Skin Type.   A Fitzpatrick Skin Type test is recommended to give your client prior to procedure.  Skin type I-IV  skin type I is the lighter and IV is the darkest. OPM 1 is for skin type 1, OPM 2 is for skin type 2, etc.   APPLICATION:  OPM pigments are concentrated water based pigments and go in easily with gentle penetration in the skin. ', ''),
(19, 'OPM-8 ESPRESSO', 'Organic mineral driven pigment for specific undertone skintype. Espresso for skintype 1-5 eye color.', '<p>Organic mineral driven pigment for specific undertone skintype. Espresso for skintype 1-5 eye color.</p>\r\n\r\n<p>EYELINER Colors.&nbsp; Select color based on client consultation.&nbsp; OPM has four colors to select from:</p>\r\n\r\n<p>Black (OPM 12)<br />\r\nEspresso (OPM 8)<br />\r\nJade &nbsp;(OPM 6) &ndash; blue and green eyes<br />\r\nAqua Teal (OPM 7) - blue and green eyes</p>\r\n\r\n<p>CONSULTATION:&nbsp; We recommend doing an in-depth client consultation prior to any permanent makeup services.&nbsp;&nbsp; OPM PIGMENTS are formulated based on the Fitzpatrick Skin Type.&nbsp;&nbsp; A Fitzpatrick Skin Type test is recommended to give your client prior to procedure.&nbsp; Skin type I-IV&nbsp; skin type I is the lighter and IV is the darkest. OPM 1 is for skin type 1, OPM 2 is for skin type 2, etc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>APPLICATION:&nbsp; OPM pigments are concentrated water based pigments and go in easily with gentle penetration in the skin.</p>\r\n', 'OPM-8', 75, 0, 'шт', '2014-09-26', 1008, 1, 0, 0, 0, 1, 'opm-8-espresso', 'OPM-8 ESPRESSO', 'Organic mineral driven pigment for specific undertone skintype. Espresso for skintype 1-5 eye color. EYELINER Colors.  Select color based on client consultation.  OPM has four colors to select from: Black (OPM 12) Espresso (OPM 8) Jade  (OPM 6) – blue and green eyes Aqua Teal (OPM 7) - blue and green eyes CONSULTATION:  We recommend doing an in-depth client consultation prior to any permanent makeup services.   OPM PIGMENTS are formulated based on the Fitzpatrick Skin Type.   A Fitzpatrick Skin Type test is recommended to give your client prior to procedure.  Skin type I-IV  skin type I is the lighter and IV is the darkest. OPM 1 is for skin type 1, OPM 2 is for skin type 2, etc.   APPLICATION:  OPM pigments are concentrated water based pigments and go in easily with gentle penetration in the skin. ', ''),
(20, 'OPM-9 ROSE', 'Organic mineral driven pigment for specific undertone skintype. Rose for Skin type 1-5 lip color.', '<p>Organic mineral driven pigment for specific undertone skintype. Rose for Skin type 1-5 lip color.</p>\r\n\r\n<p>LIP Colors &ndash; select color based on client consultation. &nbsp;OPM has four lip colors. Possibilities are endless as colors can be intermixed to create a unique shade for each of your clients.</p>\r\n\r\n<p>Rose (OPM 9) &ndash; natural rose tint<br />\r\nNude Beige (OPM 10) - most popular for a natural look<br />\r\nRed (OPM 11) &ndash; never use red alone, use to darken other shades<br />\r\nChili (OPM 13) &ndash; very nice hot red; but not a natural look</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>CONSULTATION:&nbsp; We recommend doing an in-depth client consultation prior to any permanent makeup services.&nbsp;&nbsp; OPM PIGMENTS are formulated based on the Fitzpatrick Skin Type.&nbsp;&nbsp; A Fitzpatrick Skin Type test is recommended to give your client prior to procedure.&nbsp; Skin type I-IV&nbsp; skin type I is the lighter and IV is the darkest. OPM 1 is for skin type 1, OPM 2 is for skin type 2, etc.</p>\r\n\r\n<p>APPLICATION:&nbsp; OPM pigments are concentrated water based pigments and go in easily with gentle penetration in the skin. &nbsp;&nbsp;</p>\r\n\r\n<p>MACHINE preference: recommend utilizing the OPM Machine or a digital machine, which has less of a vibration. The OPM Machine is a digital machine using a magnet in the motor resulting in no vibration on the tip of the needle.&nbsp; With no vibration in the tip of the needle, there is considerably less or no bleeding (depending on skin).&nbsp;</p>\r\n', 'OPM-9 ROSE', 75, 0, 'шт', '2014-09-26', 1009, 1, 0, 0, 0, 1, 'opm-9-rose', 'OPM-9 ROSE', 'Organic mineral driven pigment for specific undertone skintype. Rose for Skin type 1-5 lip color. LIP Colors – select color based on client consultation.  OPM has four lip colors. Possibilities are endless as colors can be intermixed to create a unique shade for each of your clients. Rose (OPM 9) – natural rose tint Nude Beige (OPM 10) - most popular for a natural look Red (OPM 11) – never use red alone, use to darken other shades Chili (OPM 13) – very nice hot red; but not a natural look   CONSULTATION:  We recommend doing an in-depth client consultation prior to any permanent makeup services.   OPM PIGMENTS are formulated based on the Fitzpatrick Skin Type.   A Fitzpatrick Skin Type test is recommended to give your client prior to procedure.  Skin type I-IV  skin type I is the lighter and IV is the darkest. OPM 1 is for skin type 1, OPM 2 is for skin type 2, etc. APPLICATION:  OPM pigments are concentrated water based pigments and go in easily with gentle penetration in the skin.    MACHINE preference: recommend utilizing the OPM Machine or a digital machine, which has less of a vibration. The OPM Machine is a digital machine using a magnet in the motor resulting in no vibration on the tip of the needle.  With no vibration in the tip of the needle, there is considerably less or no bleeding (depending on skin).  ', ''),
(21, 'OPM® Anesthetic Cream', 'Ultra concentrated topical cream anesthetic. Essential for preparing the skin prior to treatment.', '<p><span style="color:#008000"><span style="font-size:16px"><strong>Ultra concentrated topical cream anesthetic</strong>.</span></span></p>\r\n\r\n<p>Essential for preparing the skin prior to treatment.</p>\r\n', 'OPM-ANESTHETIC CREAM STEP 1', 65, 0, 'шт', '2014-09-26', 1201, 1, 0, 0, 0, 1, 'opm-anesthetic-cream', 'OPM® Anesthetic Cream', 'Ultra concentrated topical cream anesthetic. Essential for preparing the skin prior to treatment. ', 'anesthetic cream; permanent makeup anesthetic cream; opm anesthetic cream; concentrated cream anesthetic; concentrated topical cream anesthetic; skin anesthetic cream; prior to treatment skin anesthetic cream;'),
(22, 'OPM® Anesthetic Gel - 2', 'Ultra concentrated topical anesthetic gel. Fast acting. Essential during skin treatment process for immediate results.', '<p>Ultra concentrated topical anesthetic gel. Fast acting. Essential during skin treatment process for immediate results.</p>\r\n', 'OPM- ANESTHETIC GEL STEP 2', 65, 0, 'шт', '2014-09-26', 1102, 1, 0, 0, 0, 1, 'opm-anesthetic-gel2', 'OPM® Anesthetic Gel - 2', 'Ultra concentrated topical anesthetic gel. Fast acting. Essential during skin treatment process for immediate results. ', ''),
(23, 'OPM® ERASER', 'Pigment Eraser for Skin types 1-5.', '<p>Pigment Eraser for Skin types 1-5.</p>\r\n\r\n<p>INSTRUCTIONS&nbsp;</p>\r\n\r\n<p>1) Sanitize the area that it will be removed<br />\r\n2) Apply OPM numbing cream with Q-tip.<br />\r\n3) Cover with plastic wrap for 10-15min<br />\r\n4) Go over the unwanted area with your&nbsp;permanent makeup machine with the dry needle- do NOT use pigment<br />\r\n5) To know that you have gone deep enough the skin must bleed<br />\r\n6) Make sure that you inject the needle over the unwanted pigment.&nbsp;<br />\r\n7) Apply the OPM Eraser with a Q-tip over the unwanted pigment area that has just been opened<br />\r\n8) The skin should turn a frosty white color<br />\r\n9) Allow OPM Eraser to penetrate into the area for 2-3 minutes, then wipe off with cold water&nbsp;</p>\r\n', 'OPM ERASER', 95, 0, 'шт', '2014-09-26', 1201, 1, 0, 0, 0, 1, 'opm-eraser', 'OPM® ERASER', 'Pigment Eraser for Skin types 1-5. INSTRUCTIONS  1) Sanitize the area that it will be removed 2) Apply OPM numbing cream with Q-tip. 3) Cover with plastic wrap for 10-15min 4) Go over the unwanted area with your permanent makeup machine with the dry needle- do NOT use pigment 5) To know that you have gone deep enough the skin must bleed 6) Make sure that you inject the needle over the unwanted pigment.  7) Apply the OPM Eraser with a Q-tip over the unwanted pigment area that has just been opened 8) The skin should turn a frosty white color 9) Allow OPM Eraser to penetrate into the area for 2-3 minutes, then wipe off with cold water  ', ''),
