INSERT INTO `tbl_service` (`id`, `name`, `content`, `description`, `site_content`, `contract`, `site_name`, `view_on_site`, `url`, `seo_title`, `seo_description`, `seo_keywords`, `is_view`, `position`) VALUES
(1, 'Eyebrows', '<p>Eyebrow Contouring - $500</p>\r\n\r\n<p>After 4-6 weeks touch up appointment - $0&nbsp;</p>\r\n\r\n<p>After 365 days&nbsp;yearly touch up - $150</p>\r\n\r\n<p>After 2 years - $300&nbsp;</p>\r\n\r\n<p>After 3 -4 year - $400</p>\r\n\r\n<p>After 5 years - $500</p>\r\n\r\n<p>For example if Samantha came on&nbsp;</p>\r\n\r\n<p>10/10/14 for 1st time eyebrows - $500</p>\r\n\r\n<p>11/10/14 for touch up - $0</p>\r\n\r\n<p>11/10/15 touch up is - $150 | if she comes every year after that is only - $150 | But if she skips a year is - $300 | if she skips 3-4 years - $400 | after 5 years she will pay - $500 again</p>\r\n', 'For those who want a dramatic looking brow that will appear more exotic with a full arch.', '<h2>Eyebrows</h2>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/eyebrows.png" /></div>\r\n\r\n<h2>Brow/Eyeliner Combination</h2>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/brow-eyeliner-cobination.png" /></div>\r\n', 1, 'Eyebrow Contouring', 1, 'eyebrow-contouring', 'Eyebrow Contouring', 'Eyebrow Contouring ', '', 1, 1151),
(2, 'Eyeliner upper and lower', '<p><span style="font-size:14px">Eyeliner $350 for upper or lower ( sometimes I give them a discount if they get more then&nbsp;</span><span style="font-size:14px">Procedure)</span></p>\r\n\r\n<p><span style="font-size:14px">After 4-6 weeks touch up appointment - $0&nbsp;</span></p>\r\n\r\n<p><span style="font-size:14px">After 365 days&nbsp;yearly touch up - $150</span></p>\r\n\r\n<p><span style="font-size:14px">After 2 years - $300&nbsp;</span></p>\r\n\r\n<p><span style="font-size:14px">After 3 -4 year - $400</span></p>\r\n\r\n<p><span style="font-size:14px">After 5 years - $500</span></p>\r\n\r\n<p><span style="font-size:14px">For example if Samantha came on&nbsp;</span></p>\r\n\r\n<p><span style="font-size:14px">10/10/14 for 1st time eyebrows - $500</span></p>\r\n\r\n<p><span style="font-size:14px">11/10/14 for touch up - $0</span></p>\r\n\r\n<p><span style="font-size:14px">11/10/15 touch up is - $150 | if she comes every year after that is only - $150 | But if she skips a year is - $300 | if she skips 3-4 years - $400 | after 5 years she will pay - $500 again</span></p>\r\n', 'This is full liner for upper and lower lids for those who want to look<br />\r\n“made up” all the time.', '<h2>Eyeliner</h2>\r\n\r\n<p>Upper / Lower</p>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/Eyeliner-upper-lower.jpg" /></div>\r\n', 1, 'Eyeliner Color Full Liner - (Upper/Lower)', 1, 'eyeliner-upper-or-lower', 'Eyeliner upper or lower', 'Eyeliner upper or lower ', '', 1, 1030),
(3, 'Lip liner', '<p>Lip liner</p>\r\n', 'This procedure is great for those who may be happy with the size of their lips but not the shape.Our Lip Liner enables us to reshape your lips.', '<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/Lip-Liner-lips.jpg" /></div>\r\n', 1, 'Lip Liner', 1, 'lip-liner', 'Lip liner', 'Lip liner ', '', 1, 1021),
(4, 'Full Lips', '<p>Full Lips -<span style="font-size:14px">&nbsp;$750&nbsp;</span></p>\r\n\r\n<p>After 4-6 weeks touch up appointment - $0&nbsp;</p>\r\n\r\n<p>After 365 days&nbsp;yearly touch up - $150</p>\r\n\r\n<p>After 2 years - $300&nbsp;</p>\r\n\r\n<p>After 3 -4 year - $400</p>\r\n\r\n<p>After 5 years - $500</p>\r\n\r\n<p>For example if Samantha came on&nbsp;</p>\r\n\r\n<p>10/10/14 for 1st time eyebrows - $500</p>\r\n\r\n<p>11/10/14 for touch up - $0</p>\r\n\r\n<p>11/10/15 touch up is - $150 | if she comes every year after that is only - $150 | But if she skips a year is - $300 | if she skips 3-4 years - $400 | after 5 years she will pay - $500 again</p>\r\n', 'This is a great procedure for those who are looking to slightly enhance the size of their lips.Our lip liner and lip blend will leave your lips looking natural, full and beautiful at all times.', '<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/screenshot-by-nimbus-1.jpg" /></div>\r\n', 1, 'Full Lip Color', 1, 'full-lips-color', 'Full Lips Color', 'Full Lips Color ', '', 1, 1131),
(5, 'Retouch', '<p>Retouch</p>\r\n', '', '<h2>OPM Make Up</h2>\r\n\r\n<p>Our exclusive <strong>OPM&reg; Organic Permanent Makeup System</strong> uses state of the art equipment, the highest quality <strong>Derma Blush&reg;</strong> organic pigments, and exquisite artistry. The results are safer and more natural than conventional permanent makeup.</p>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-12.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-22.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-3.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-4.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-5.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-6.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-7.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-8.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-9.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-make-up-10.jpg" /></div>\r\n', 1, 'OPM Make Up', 1, 'retouch', 'Retouch', 'Retouch ', '', 1, 1031),
(6, 'Scalp pigmentation', '<p>Scalp pigmentation</p>\r\n', 'This a scalp pigmentation treatment that this men had. They looked very bold but after the scalp pigmentation they are very happy because no one can see their boldness.', '<p>(Male Baldness)</p>\r\n\r\n<p>This a scalp pigmentation treatment that this men had. They looked very bold but after the scalp pigmentation they are very happy because no one can see their boldness.</p>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-scalp-pigmentation-1.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-scalp-pigmentation-2.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-scalp-pigmentation-3.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-scalp-pigmentation-4.jpg" /></div>\r\n', 1, 'OPM Scalp Pigmentation', 1, 'scalp-pigmentation', 'Scalp pigmentation', 'Scalp pigmentation ', '', 1, 1051),
(7, 'Consultation', '<p>Consultation</p>\r\n', '', '', 1, '', 0, 'consultation', 'Consultation', 'Consultation ', '', 1, 50),
(9, 'Scar', '<p>Scar</p>\r\n', '', '<h2>OPM Medical</h2>\r\n\r\n<h2>Upper eyeliner correction</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/upper-eyeliner-correction.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>This is an amazing transformation for this women that had eye surgery and could not fill in the gap in between her lashes we were able to fix it with our OPM system we gave her color to full fill in her missing lashes.</p>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>Eyebrow scar</h2>\r\n\r\n<p>This was a scar that was not growing any hair and after applying our opm pigments we were able to cover the space and have hair look more natural look</p>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/eyebrow-scar-1.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/eyebrow-scar-2.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>Lip Clift correction</h2>\r\n\r\n<p>This client was born with a lip Clift we were able to give her more of a natural shape to her lips with a more define and more attractive looking lips.</p>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-lip-cleft-correction.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/lip-clift-correction-2.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>Areola Restoration</h2>\r\n\r\n<p>&amp;This procedure is for those who have had a mastectomy and lost their areola. We are able to restore color and shape so you can feel like yourself again. This is an areola restoration after a double mastectomy, we used 4 colors to create a natural look on this areola.</p>\r\n\r\n<div class="col-sm-4"><img alt="" src="/upload/files/pages_images/areola-restoration-1.jpg" /></div>\r\n\r\n<div class="col-sm-4"><img alt="" src="/upload/files/pages_images/areola-restoration-2.jpg" /></div>\r\n\r\n<div class="col-sm-4"><img alt="" src="/upload/files/pages_images/areola-restoration-3.jpg" /></div>\r\n', 1, 'OPM Medical', 1, 'scar1', 'Scar - part 2', 'Scar ', '', 1, 1071),
(10, 'Correction', '<p>Correction for Permanent Makeup</p>\r\n', 'OPM Correction & Removal helps you to feel natural. Removing a less than desirable permanent makeup application is similar to removing a tattoo. ', '<h2>OPM Correction &amp; Removal</h2>\r\n\r\n<h2>Eyeliner Removal</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/eyeliner-removal.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>(Side eyeliner correction)</p>\r\n\r\n<p>This was a removal of upper eyeliner, we removed the eyeliner with our OPM eraser, an amazing result.</p>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>Eyebrows Correction</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/eyebrows-correction.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>(Brush stroke eyebrows)</p>\r\n\r\n<p>This was a tattooed eyebrow 13 years old it took 3 treatment to get it to look this natural, it was very difficult to remove the blue color, and we did a removal to create natural results.</p>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>Lip Cleft Correction</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-lip-cleft-correction.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>(Lip Cleft)</p>\r\n\r\n<p>This client was born with a lip cleft we were able to give her more of a natural shape to her lips with a more define and more attractive looking lips.</p>\r\n', 1, 'OPM Correction & Removal', 1, 'correction11', 'Correction - part 2 - part 2', 'Correction for Permanent Makeup ', '', 1, 1011),
(11, 'Eyebrow Hair Stroke', '', 'This is the most popular procedure we do for a very natural hair-like stroke between your natural hairs. We can also create the appearance of hair for those who have thinning or no brow hair. Please see our gallery.', '<h2>Eyebrows</h2>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/Micro-Hair-Eyebrow-eyebrows.png" /></div>\r\n\r\n<h2>Brow/Eyeliner Combination</h2>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/Micro-Hair-Eyebrow-brow.png" /></div>\r\n', 1, 'Eyebrow Hair Stroke', 1, 'eyebrow-hair-stroke', 'Eyebrow Hair Stroke', '', '', 1, 1310),
(12, 'Lift Kiss', '', 'This procedure is for those who have thin lips.We are able to mimic the lips so they look fuller and blend the color into the lips so they look natural.This procedure has gained popularity amongst those who want fuller looking lips without injecting any fills.The results are amazing!', '<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/Lip-Liner-lips.jpg" style="height:1272px; width:923px" /></div>\r\n', 1, 'Kiss Left Lips', 1, 'lip-kiss', 'Lip Kiss', '', '', 1, 1081),
