(15, 'Botox', '<p>Botox is $7/ unit and they should redo it every 4 month same price&nbsp;</p>\r\n', '', '<h2>OPM Medi Spa Botox</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-media-botox.jpg" style="float:right; margin:0px 0px 0px 50px;" /></p>\r\n\r\n<p>Botox is one of the many trade names for the neurotoxic protein called botulinum toxin that is produced by the bacterium Clostridium botulinum.</p>\r\n\r\n<p>However, the protein is used in cosmetic medicine to treat moderate to severe brow furrow (glabellar lines), wrinkles, and facial creases. These procedures use a small amount of diluted botulinum toxin that enables controlled weakening of muscles.</p>\r\n\r\n<p>Botox can be used on the face to help reduce wrinkles, consultation is important before getting started. We see that with Botox you can also prevent wrinkles. And it is also to know that botox takes 5-7 days to take affect, and should last 3-4 month but we have notice for those that work out it only lasts about 2 month.</p>\r\n\r\n<p>Please call if you want to know more information about Botox, you can try our introductory offer of $119 for 20 units of botox (book online only offer).</p>\r\n', 1, 'OPM Medi Spa Botox', 1, 'botox', 'Botox', 'Botox is $7/ unit and they should redo it every 4 month same price  ', '', 1, 1210),
(16, 'Filler', '', '', '', 1, '', 0, 'filler', 'Filler', '', '', 1, 1000),
(18, 'Radiesse', '<p>Radiesse&nbsp;-&nbsp;$500/syringe</p>\r\n\r\n<p>They should redo it every 8 month same price of - $500/syringe</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1) Yes when they first come we can say procedure 1, price is $500( for 1 year free retouch)</p>\r\n\r\n<p>2) When they second time, come after 6 weeks, 42 days (procedure 2), they do not pay for retouch if they pay $500 in first procedure.</p>\r\n\r\n<p>3) They pay after 365 days, retouch $150 (procedure 3)</p>\r\n\r\n<p>4) And after 1 year again it is retouch too, $150 (procedure 4)</p>\r\n\r\n<p>Re-touch, Lorine makes corrections and put colors again if customers needed.</p>\r\n', '', '', 1, '', 0, 'raddis', 'Raddis', 'Raddis ', '', 1, 1000),
(19, 'Juvederm', '<p>Juvederm - $350/syringe</p>\r\n\r\n<p>They should redo it every 6 Month same price&nbsp;- $350/syringe</p>\r\n', '', '', 1, '', 0, 'juvederm', 'JuveDerm', 'JuveDerm ', '', 1, 1000),
(20, 'Areola', '<p>Areola</p>\r\n\r\n<p>For Areola, we need retouch after 365 days.</p>\r\n', 'This procedure is for those who have had a mastectomy and lost their areola. We are able to restore color and shape so you can feel like yourself again.', '<p>This procedure is for those who have had a mastectomy and lost their areola. We are able to restore color and shape so you can feel like yourself again.</p>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/areola-restoration-1.jpg" style="height:608px; width:450px" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/areola-restoration-2.jpg" style="height:608px; width:450px" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/areola-restoration-3.jpg" /></div>\r\n', 1, 'Areola Restoration', 1, 'areola', 'Areola', 'Areola For Areola, we need retouch after 365 days. ', '', 1, 1110),
(21, 'Skin Tag Remover', '<p>Skin Tag Remover</p>\r\n', '', '', 1, '', 0, 'skin-tag-remover', 'Skin Tag Remover', 'Skin Tag Remover ', '', 1, 1000),
(22, 'Unique Service', '<p>Unique Service</p>\r\n', '', '<h2>OPM Medi Spa</h2>\r\n\r\n<h2>Botox</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/botox.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>Botox is one of the many trade names for the neurotoxic protein called botulinum toxin that is produced by the bacterium Clostridium botulinum.</p>\r\n\r\n<p>However, the protein is used in cosmetic medicine to treat moderate to severe brow furrow (glabellar lines), wrinkles, and facial creases. These procedures use a small amount of diluted botulinum toxin that enables controlled weakening of muscles.</p>\r\n\r\n<p>Botox can be used on the face to help reduce wrinkles, consultation is important before getting started. We see that with Botox you can also prevent wrinkles. And it is also to know that botox takes 5-7 days to take affect, and should last 3-4 month but we have notice for those that work out it only lasts about 2 month.</p>\r\n\r\n<p>Please call if you want to know more information about Botox, you can try our introductory offer of $119 for 20units of botox (book online only offer).</p>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>Filler Injections</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/filler.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>Filler injections are a cosmetic treatment used to smooth wrinkles or pitted scars in the skin, usually on the face. They are also used to make the lips fuller. When injected under the skin, a filler raises or puffs up that area.</p>\r\n\r\n<p>This usually goes away over time. There are many kinds of injectable fillers, including, hyaluronic acid are sugar base fillers good for area around between the eyebrows and lips and around the lip area. Other fillers are calcium base fillers and those are good around the lips and they last longer then the hyaluronic acid fillers.</p>\r\n\r\n<p>A consultation is very important to understand the desire of your need. Fillers are great to get reduce the look of wrinkles that is cause by aging and due to gravity. Fillers can last up to one year.</p>\r\n\r\n<p>Try our first time one time try for hyaluronic acid for $250 one area call now if you have any information or book this offer online.</p>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>Microdermabrasion</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/microderm.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>Microdermabrasion is a painless, noninvasive, skin-rejuvenation procedure using a combination of a fine abrasive tip or crystals and vacuum suction applied to the skin. Typically there are no needles or anesthetics required for microdermabrasion. The vacuum pressure and speed are adjusted depending on the sensitivity and tolerance of the skin. Microdermabrasion is often compared to the feeling of a cat licking your face, a rough but gentle texture. Typical microdermabrasion sessions can last anywhere from five to 60 minutes. Minimal to no recovery time is required after microdermabrasion and most people immediately return to daily activity after a session. Makeup and nonirritating creams can usually be applied right after microdermabrasion. Studies have shown that microdermabrasion can even facilitate the absorption of some topical medications through increasing the permeability of the skin.</p>\r\n\r\n<p>Microdermabrasion works by removing a few of the top layers of the skin called the stratum corneum. Much like brushing your teeth, microderm helps to gently remove &ldquo;plaque&rdquo; and skin debris. Since human skin typically regenerates at approximately 30-day intervals, skin improvement with microdermabrasion is temporary and needs to be repeated at average intervals of two to four weeks for continued improvement. Multiple treatments in combination with sunscreen, sun avoidance, and other skin-care creams yield best results.</p>\r\n\r\n<p>Try our special offer one treatment of microdermabrasion for only $65.00</p>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>OPM Laser Hair Removal</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/OPM-Laser-Hair-Removal.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>Laser hair removal or IPL is the process of removing unwanted hair by means of exposure to pulses of laser light that destroy the hair follicle.</p>\r\n\r\n<p>The primary principle behind laser hair removal is selective photothermolysis (SPTL), the matching of a specific wavelength of light and pulse duration to obtain optimal effect on a targeted tissue with minimal effect on surrounding tissue.</p>\r\n\r\n<p>Lasers can cause localized damage by selectively heating dark target matter, melanin, in the area that causes hair growth, the follicle, while not heating the rest of the skin. Light is absorbed by dark objects, so laser energy can be absorbed by dark material in the skin, but with much more speed and intensity. This dark target matter, or chromophore, can be naturally-occurring or artificially introduced.</p>\r\n\r\n<p>Our machine is extremely safe and very effective, there is no pain and very gentle, our machine is unique because it shoots 10-shot/ sec. covering larger area in a very short time.</p>\r\n', 1, 'OPM Medi Spa', 1, 'unique-service', 'Unique Service', 'Unique Service ', '', 1, 1141),
(23, 'Camouflage', '<p>Camouflage</p>\r\n', '', '<h2>Permanent Makeup and Tattoo Correction / Removal</h2>\r\n\r\n<p>Are you unhappy with your permanent makeup? Did your permanent makeup artist perform unsatisfactory work on&nbsp;your eyebrows, eyeliner or lips?&nbsp; Don&rsquo;t worry&hellip;Lorine can fix it!</p>\r\n\r\n<p>&nbsp;Lorine is an expert Permanent Makeup Technician with many years of experience with corrective work.&nbsp; She can help remove and/or repair unpleasant or unnatural makeup tattoos without the use of laser.</p>\r\n\r\n<p>Lorine has discovered a new, safe and effective way of removing permanent makeup from the face. Guaranteed to produce amazing results, she will use her innovative formula to safely remove the unwanted ink or makeup.</p>\r\n\r\n<p>&nbsp;The procedure is a much safer and more effective&nbsp;alternative to the conventional laser tattoo removal, which is harmful around the face, especially the eye area.</p>\r\n\r\n<p>&nbsp;Call us for a FREE consultation.&nbsp; You can also email a photo to&nbsp;op@opmakeup.com&nbsp;and we&nbsp;will contact you.</p>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/Permanent-Makeup-Removal-Permanent-Makeup.jpg" /></div>\r\n', 1, 'Permanent Makeup and Tattoo Correction / Removal', 1, 'camouflage1', 'Camouflage - part 2', 'Camouflage ', '', 1, 1121),
(24, 'Eyebrow Correction', '', '', '', 1, '', 0, 'eyebrow-correction1', 'Eyebrow Correction - part 2', '', '', 1, 1000),
(34, 'Body Services', '<p>Body Services</p>\r\n', '', '<h2>OPM Laser Hair Removal</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/OPM-Laser-Hair-Removal.jpg" style="float:right; margin:0px 0px 0px 50px"/></p>\r\n\r\n<p>Laser hair removal or IPL is the process of removing unwanted hair by means of exposure to pulses of laser light that destroy the hair follicle.</p>\r\n\r\n<p>The primary principle behind laser hair removal is selective photothermolysis (SPTL), the matching of a specific wavelength of light and pulse duration to obtain optimal effect on a targeted tissue with minimal effect on surrounding tissue.</p>\r\n\r\n<p>Lasers can cause localized damage by selectively heating dark target matter, melanin, in the area that causes hair growth, the follicle, while not heating the rest of the skin. Light is absorbed by dark objects, so laser energy can be absorbed by dark material in the skin, but with much more speed and intensity. This dark target matter, or chromophore, can be naturally-occurring or artificially introduced.</p>\r\n\r\n<p>Our machine is extremely safe and very effective, there is no pain and very gentle, our machine is unique because it shoots 10-shot/ sec. covering larger area in a very short time.</p>\r\n\r\n<p>An average area needs 4 to 6 treatment 4 to 6 weeks in-between. Area must be shaved 24hrs before treatment for best result. It is important to understand that best candidate for laser hair removal are whit skin dark hair.</p>\r\n\r\n<p>The treatment is not very effective for those that are whit skin and whit hair or for those that are black skin and black hair. Laser is attracted to dark color so it is perfect for those that have dark hair and light skin because we can easily destroy the hair follicle, but for white hair is not very effective.</p>\r\n\r\n<p>As for black skin the laser can cause more damage to the skin as hypopigmentation and the skin can be burned because laser is attracted to black color and there for is not recommended for dark black skin.</p>\r\n\r\n<p>Please call us now for a free consultation, try our introductory offer 4 underarm treatment or 4-bikini line for only $99 (must book online).</p>\r\n', 1, 'OPM Laser Hair Removal', 1, 'body-services', 'Body Services', 'Body Services ', '', 1, 1111),
