(43, 'Upper Eyeliner', '', 'This procedure is great for those who have blue, green or hazel eyes and want the smoky eye affect. With the two colors we are able to give the eyes definition with one color and smoke the eyes with a second color of aqua, teal or olive green to bring out the natural color of the eyes', '<h2>Eyeliner</h2>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/Eyeliner-upper-lower.jpg" /></div>\r\n\r\n<p>Upper / Lower</p>\r\n', 1, 'Color Full Liner-(Upper/Lower)', 1, 'upper-eyeliner', 'Upper Eyeliner', '', '', 1, 1101),
(44, 'Lower Eyeliner', '', 'This procedure is amazing for those with large eyes who would like to bring out their natural eye color while removing the focus from their sclara (the white portion of the eye). This sexy procedure is very popular among the Indian, Black and Middle Eastern cultures, or those that have large eyes', '<h2>Eyeliner</h2>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/Eyeliner-upper-lower.jpg" /></div>\r\n\r\n<p>Upper / Lower</p>\r\n', 1, 'Mucosal Liner', 1, 'lower-eyeliner', 'Lower Eyeliner', '', '', 1, 1091),
(45, 'Eyeliner Correction', '', '', '', 1, '', 0, 'eyeliner-correction', 'Eyeliner Correction', '', '', 1, 1000),
