INSERT INTO `tbl_trade` (`id`, `name`, `description`, `content`, `date`, `is_view`, `url`, `seo_title`, `seo_description`, `seo_keywords`) VALUES
(3, 'Toronto Esthetics Show', 'We are proud to introduce the next level of Permanent Makeup for you to experience with your clients.  Organic Permanent Makeup is certified OPM organic mineral and water based pigments that are formulated for each skin type.  Our pigments contain no alcohol or iron oxides so your client’s brows will not oxidize to orange or green over time.  You would be using a new revolutionary digital system that produces no bleeding or trauma to the skin due to the design of the system and the correct permanent makeup training.  Therefore, your clients will leave your service with beautiful brows that requires no aftercare and in 2-5 years they will come back for a touch-up.', '<p><strong>Why consider Organic Permanent Makeup?</strong></p>\r\n\r\n<p><span style="line-height:1.6em">You would be able to offer a hot, new high-end service with a starting price of $250 for brows, $250 for eyeliner and/or $350 for full lips.&nbsp; The concept is enticing to clients because your service would be virtually painless and you would use organic pigments that stay their true color.&nbsp; Your clients will have 100% smudge-free color with no bleeding or trauma to the skin after their service.&nbsp; And, by the way, we have an OPM eraser system for correction and removal of unwanted color.&nbsp; This state-of-the-art technique is medically approved and specifically designed to be completely safe.&nbsp;</span></p>\r\n\r\n<p>We offer training that is designed to give you the most comprehensive teaching experience so that you can begin working <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="00453228-26b6-4693-9292-e38b6df89319" id="6f9a1c93-7f5e-4806-bb1c-b808d6dc8873">on</gs> clients in a rather short amount of time.&nbsp; <span style="color:#00FF00"><strong>Classes will be held this coming August of 2015, so this is your chance to not miss out!</strong></span>&nbsp;</p>\r\n\r\n<p><span style="line-height:1.6em">Please give our office a call or email us with questions you may have to become a Certified Organic Permanent Makeup Artist!</span></p>\r\n\r\n<p><strong><span style="line-height:1.6em">We are not just Permanent Makeup</span></strong><span style="line-height:1.6em"><strong><gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="6cf5d7e2-9a28-440f-9607-02c33715789e" id="97262adf-2107-4418-aebc-35dc648043d1">&hellip;</gs></strong></span><strong><span style="line-height:1.6em">We are Organic Permanent Makeup!!</span></strong></p>\r\n', '2015-08-03', 1, 'toronto-esthetics-show', 'Toronto Esthetics Show', '', '');
