(1, 'Permanent Eyebrow Tutorial Course 1 123123', '<p>Permanent eyebrow procedures are in high demand as they have helped men and women to look younger, adding definition to the face. With a vast market and huge profit, eyebrow procedures are essential to know. &bull; Balance out asymmetrical brows &bull; Raise droopy brows &bull; Fill in sparse or patchy brows &bull; Soften the surprised look of high arched brows &bull; Reshape brows that are too thin, long, or wide Nearly everyone can enhance their look with permanent eyebrows if the correct techniques are used. With the BioTouch permanent eyebrow procedure video tutorial, you&rsquo;ll get an in-depth look at the entire process, including shaping the eyebrows, preparing the area with anesthetics, proper needle placement and depths, and needle movement techniques for best pigment retention. *This Tutorial does not cover feather touch techniques</p>\r\n', '<p>Permanent eyebrow procedures are in high demand as they have helped men and women to look younger, adding definition to the face.</p>\r\n\r\n<p>With a vast market and huge profit, eyebrow procedures are essential to know.</p>\r\n\r\n<p>&bull; Balance out asymmetrical brows<br />\r\n&bull; Raise droopy brows<br />\r\n&bull; Fill in sparse or patchy brows<br />\r\n&bull; Soften the surprised look of high arched brows<br />\r\n&bull; Reshape brows that are too thin, long, or wide</p>\r\n\r\n<p>Nearly everyone can enhance their look with permanent eyebrows if the correct techniques are used. With the BioTouch permanent eyebrow procedure video tutorial, you&rsquo;ll get an in-depth look at the entire process, including shaping the eyebrows, preparing the area with anesthetics, proper needle placement and depths, and needle movement techniques for best pigment retention.</p>\r\n\r\n<p>*This Tutorial does not cover feather touch techniques</p>\r\n', 1, 1000, '<iframe width="854" height="510" src="//www.youtube.com/embed/3WdmYwp3ev0" frameborder="0" allowfullscreen></iframe>', 150, '<iframe width="854" height="510" src="//www.youtube.com/embed/mn3-A08eK0k" frameborder="0" allowfullscreen></iframe>'),
