</span></p>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px"><strong><a href="/service/gallery/permanent-makeup-and-tattoo-correctionremoval">Permanent Make-Up</a></strong></span></li>\r\n	<li><span style="font-size:16px"><strong><a href="/service/gallery/organic-micro-hair-scalp-pigmentation">Hair Pigmentation</a></strong></span></li>\r\n	<li><span style="font-size:16px"><strong><a href="/service/gallery/faces">Photo Facial</a></strong></span></li>\r\n	<li><span style="font-size:16px"><strong><a href="/service/gallery/lips">Lips Liner</a></strong></span></li>\r\n	<li><span style="font-size:16px"><strong><a href="/service/gallery/eyebrows">Eyebrows</a></strong></span></li>\r\n	<li><span style="font-size:16px"><strong><a href="/service/gallery/eyeliner">Eyeliner</a></strong></span></li>\r\n	<li><span style="font-size:16px"><strong><a href="/service/gallery/areola-restoration">Areola Restoration</a></strong></span></li>\r\n</ul>\r\n\r\n<p><span style="font-size:16px"><strong>Sign up now and GET A FREE retouch and look almost 10 years younger.</strong></span></p>\r\n<a class="btn" href="/site/quick/2">GET A FREE RETOUCH</a></div>\r\n\r\n<div class="col-xs-12 col-sm-6 col-md-6">\r\n<h2>TRAINING PROGRAM</h2>\r\n\r\n<p><span style="font-size:16px">Our training program focuses on the specific technique that creates the best strokes for the top of the industry results.</span></p>\r\n\r\n<p><span style="font-size:16px">In addition, to the OPM technique we have a uniquely created magnetic machine. Including OPM&rsquo;s patented organic pigments.</span></p>\r\n\r\n<p><span style="font-size:16px"><strong>PROGRAM INCLUDES:</strong></span></p>\r\n\r\n<ul>\r\n	<li><span style="font-size:16px"><gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="b18b977a-8377-43ac-9d90-e2226986c2d1" id="5064fd45-ed3a-4ecc-83d6-b9310bd91489">Derma</gs> science</span></li>\r\n	<li><span style="font-size:16px">Brief training bullet outline</span></li>\r\n	<li><span style="font-size:16px">Video tutorials</span></li>\r\n	<li><span style="font-size:16px">Practice materials</span></li>\r\n</ul>\r\n\r\n<p><span style="font-size:16px"><strong>Click here&nbsp;to receive a FREE VIDEO&nbsp;worth $150</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a class="btn" href="/site/quick/3">GET A TRAINING COURSE</a></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'front_page', ' Why OPM® Organic Permanent Makeup is The Best in Los Angeles? ', 'Our exclusive OPM® Organic Permanent Makeup system uses state of the art equipment, the highest quality', ''),
(2, 'About', '<h2>Meet Lorine Mikhaeil OPM&reg; Founder</h2>\r\n\r\n<p><img alt="" src="/upload/files/pages_images/about_img1.png" style="float:right; margin:0px 0px 0px 50px; max-width:200px" /></p>\r\n\r\n<p>Lorine Mikhaeil leads a busy life. A trained nurse and a certified permanent makeup artist, she helms Organic Permanent Makeup (OPM&reg;) as well as Zena Day Spa, Derma Blush&reg;, and American Permanent Cosmetics Institute. But no matter how busy Lorine gets, she always has time for her clients.</p>\r\n\r\n<p>At OPM, Lorine uses a semi-permanent organic pigment to expertly define brows, lips, eyelids, and even areolas for those affected by breast cancer. This metal-free formulation gives her greater control when she is applying the ink into the upper dermal layer.</p>\r\n\r\n<p>During these treatments, Lorine uses an advanced power pin, and for the brows a specialized brushstroke method she invented herself, which gives the illusion of 3D brow strands. To ensure clients are inked with complementing colors, Lorine refers to the Fitzpatrick skin type chart to ensure appropriate match for their skin tone and auras.</p>\r\n\r\n<p>​Though OPM&rsquo;s name focuses on one service, the boutique spa&rsquo;s menu is brimming with a range of other aesthetic treatments. Unwanted hair stands no chance against OPM&rsquo;s multiple hair removal systems that include waxing, threading, and laser hair removal. In addition, dermal filler, microdermbrasions, and CO2 laser keep complexions firm and flawless.</p>\r\n\r\n<hr />\r\n<h2>Lorine&rsquo;s expert technique</h2>\r\n\r\n<p>Lorine&rsquo;s artistry and experience have given her the ability to give her customers the most natural and flattering results. Her technique is exquisite. Her &ldquo;Micro Hair&rdquo; brushstrokes gives eyebrows a natural appearance that accentuate your features and color, rather than drawing attention to them. Her method of applying eyeliner and lip color is precise, and truly artistic. If you desire perfect results, Lorine will work with you to make you feel your most beautiful.</p>\r\n\r\n<hr />\r\n<h2>Why our Derma Blush&reg; is the best in the organic permanent makeup industry</h2>\r\n\r\n<p>Our organic inks are made from original formulas that reflect light, leaving a soft appearance that blends naturally with the skin. These inks are known for their stability, longevity, and reliability. The organic inks are healthier and safer for the body and skin. These inks are reliable and safe because the harsh metals, which typically are found in other inks, have been removed. Once the metals are removed from the ink, the organic compound exists as a concentrated natural formula of color.</p>\r\n\r\n<p>OPM stays away from the use of metallic inks because the iron oxides and other metals, found in metallic inks, are known to fade quickly and have a tendency to turn an unnatural pink, gray, or green. These unnatural metals can cause various problems like metal absorption and potentially harmful allergic reactions. When iron oxide or any other led based inks are implanted into the dermal layer of the skin, these metals are absorbed into the blood cells, and then interact against the hemoglobin. Unfortunately, the body cannot differentiate between the iron in the inks and the natural iron found in the body.</p>\r\n\r\n<p>Therefore, these unnatural metals found in the metallic inks are reportedly absorbed not only into the skin but also throughout the entire body. The iron oxide compounds that are found in most metallic inks are not entirely dangerous; the FDA has approved these inks to be used in different foods, drugs, and other cosmetics. It is important to note that these metals are not approved for implantation in the skin. The metallic inks are extremely inappropriate&nbsp;and potentially harmful when used in permanent makeup procedures.</p>\r\n\r\n<hr />\r\n<h2>Derma Blush&reg; looks natural</h2>\r\n\r\n<p>Our organic pigments natural, safe, and reliable. Applying these inks to the skin, creates a natural shadow of color that allows us to accentuate the features of the face. We are the best at what we do because we have created an exclusive pigment line which follows the Fitspatrick Skin Type chart. All skin undertones are different, Lorine does not believe in a &ldquo;one size fits all&rdquo; makeup system.</p>\r\n\r\n<p>We work with your skin&rsquo;s under tone to give our clients the best natural results based on the color and undertones of your skin. In addition, our organic pigments do not oxidize. We guarantee satisfaction, as we are confident your makeup color will not change, or fight with your skin tone. The result is a long lasting natural and softer color on the skin.</p>\r\n\r\n<hr />\r\n<h2>For Professionals:&nbsp;Why OPM is different from any other product on the market today</h2>\r\n\r\n<p>OPM has invented the Next Generation of organic derived pigment and state-of-the-art permanent makeup machines. &nbsp;OPM founder, Lorine, has a&nbsp;medical background and&nbsp;her speciality in skin care has led&nbsp;her to become an expert in permanent cosmetics since 1995.&nbsp; Her permanent cosmetic system is extremely easy to use for experienced make up technicians.&nbsp; She uses an expanded color pallette&nbsp;for different skin undertones to provide a personalized, natural look. This color system&nbsp;results&nbsp;in a beautiful and refined look. &nbsp;Not bluish&nbsp;or obviously a tattoo.</p>\r\n\r\n<p>OPM Derma Blush&reg;&nbsp;is the best organic pigment&nbsp;on the market today. OPM ink has a much higher pigment load than any other ink, and is an organic derived pigment that is completely vegan safe.&nbsp; OPM is not packed with fillers as are many of its counterparts. You will see and feel the difference. Once you work with&nbsp;OPM,&nbsp;you will notice the difference right away.</p>\r\n\r\n<p>Our machine is an amazing design system. Most machines use the vibration of the motor to move the needle up and down, causing vibration at the tip of the needle&nbsp;as you&nbsp;insert the pigment. That vibration and low speed damages the&nbsp;skin tissue, causing more bleeding, a longer healing time, and loss of pigment during the&nbsp;healing process. With this new system, we use magnetic forces to move the needle,&nbsp;causing great precison insertion. With high speed, the ink is inserted into the skin with minimal damage or trauma. This allows for faster healing, with&nbsp;minimal discomfort, bleeding, and down time. With this amazing technology and easy to use organic color, Lorine has created the best&nbsp;permanent makeup system on the market.</p>\r\n', 'about', 'About', '123 ', ''),
(3, 'FAQ', '<h2>What is Organic Permanent Makeup?<img alt="" class="img_right" src="/upload/files/pages_images/faq_img1.png" style="float:right" /></h2>\r\n\r\n<p>Organic Semi-Permanent Make-up is a state of the art technique of applying organic pigments into the outer layer of the skin. A micro-needle power pen is used that is 100% safe. This causes no downtime, takes 20 to 40 minutes and lasts 2 to 5 years.</p>\r\n\r\n<p>Eyebrows :&nbsp;with OP make-up the eyebrows can mimic the appearance of hair in the brow line. Anyone who desires a more full hair like stroke will love this procedure and the time it will save them 24/7 . Those who apply pencil can now go swimming, go to the gym and wipe their forehead without the embarrassment of losing their eyebrows. Alopecia, Trichotilloma, post-chemo patients are always surprised at how natural it looks.</p>\r\n\r\n<p>Eyeliner:&nbsp;With OP make-up you may achieve a subtle, natural look, mimicking thousands of tiny eyelashes, achieving a lash enhancement look. The implantation of organic pigments on the lash line is very popular with both male and female clients. Additional shadowing of color can be added for a soft natural liner or a bold defined line may be achieved. Ophthalmologists recommend intradermal cosmetic procedures for those who are allergic to conventional make-up or those wearing contact lenses.</p>\r\n\r\n<p>Lip Liner:&nbsp;Op Make-Up procedures for lip color is beautiful! It can appear to change the size and shape of the lips as well as the color. This procedure helps prevent lipstick from bleeding into surrounding skin. A soft pink similar to the color of a newborn baby is popular for those wanting a natural look. A more dramatic color may be achieved if desired. Also, the Kiss Lip procedure is very popular for those that want to have fuller, natural looking lips.</p>\r\n\r\n<hr />\r\n<h2>Who benefits from Permanent Make-Up?<img alt="" class="img_right" src="/upload/files/pages_images/faq_img2.png" style="float:right" /></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Men as well as Women</li>\r\n	<li>Busy people with little time to apply make-up</li>\r\n	<li>People with allergies to conventional make-up</li>\r\n	<li>Anyone who desires freedom from daily make-up application</li>\r\n	<li>Those that incapable of physically applying make-up</li>\r\n	<li>Those who are active in sports</li>\r\n	<li>Those with oily skin who tend to smear make-up easily</li>\r\n	<li>Those suffering from Aloprecia, Vitiligo and Trichotillomania</li>\r\n	<li>Men and women who desire to have an enhanced fresh and natural appearancez</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<h2>Is the procedure painful?<img alt="" class="img_right" src="/upload/files/pages_images/faq_img3.png" style="float:right" /></h2>\r\n\r\n<p>Topical anesthesia is used to minimize discomfort. In addition to the micro-needle power pen, it causes minimal to no pain.</p>\r\n\r\n<hr />\r\n<h2>How long does Organic Semi-Permanent Make-up last?</h2>\r\n\r\n<p>Organic Semi-permanent make-up lasts on average up to 2-5 years. As the skin ages and fashions change, clients have the ability to update their look.</p>\r\n\r\n<p>Touch-ups can be done annually. However, most clients get retouched once every year or two to maintain their desired look or even change the color and shape. If it is not maintained, your body will start to break down the applied pigments and fade.</p>\r\n\r\n<hr />\r\n<h2>Do I need to schedule a consultation?</h2>\r\n\r\n<p>A consultation is required prior to your procedure. The procedure can be conducted directly after the consultation. During the consultation, we discuss shape design, color and undertones. All procedures are drawn on to the skin prior to the procedure. During this process we consider the frame of the face to apply the appropriate shapes and colors to suit your skin.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p><a href="#">Schedule a consultation&hellip;</a></p>\r\n\r\n<hr />\r\n<h2>How long is my downtime?</h2>\r\n\r\n<p>There is no downtime. You may go to work immediately after the procedure. However to some aging skin, you may experience some redness and minimal swelling around the eyes and lip areas for 3 to 5 days.</p>\r\n\r\n<hr />\r\n<h2>What is involved in the recovery?</h2>\r\n\r\n<p>There will be slight swelling and redness in the skin, which will subside quickly. You may resume normal activities immediately after the procedure. Complete healing takes 3 to 5 days while the pigmentation matures and reaches its final natural color. You may continue your normal daily regimen without any worries. &nbsp;Corrective work requires more recovery time, especially when pigment is being removed. &nbsp;Everyone&rsquo;s body heals differently; patience is needed during the healing process to allow the body to heal naturally.</p>\r\n\r\n<hr />\r\n<h2>What are the differences between Conventional Permanent Makeup and Organic Semi-Permanent Makeup?</h2>\r\n\r\n<p><img alt="" src="/upload/files/pages_images/faq_img5.png" style="width:100%" /></p>\r\n\r\n<hr />\r\n<h2>Can Organic permanent makeup cause an allergic reaction?</h2>\r\n\r\n<p>Organic Permanent Makeup Pigment</p>\r\n\r\n<p>What&rsquo;s the buzz all about?</p>\r\n\r\n<p><strong>There are 2 types of pigment color ingredients used for permanent cosmetic makeup:</strong></p>\r\n\r\n<ol>\r\n	<li>Iron Oxides (Inorganic)</li>\r\n	<li>Lakes (Organics)</li>\r\n</ol>\r\n\r\n<p>Over 95% of the major permanent cosmetic makeup pigment manufacturers use both Organic and Inorganic cosmetic colorants in their pigment.<br />\r\nPermanent cosmetic application involves piercing the skin with a single or multiple sterile needles utilizing various insoluble opaque oxides, lakes and iron oxide pigments to create a semi- permanent or permanent design or decoration.</p>\r\n\r\n<p><strong>Allergic reactions in Organic pigments versus Iron Oxide pigments:</strong><br />\r\nIron oxides contain nickel and a large percentage of the population tested allergic to nickel (17.9%). Tattoo needles, including surgical grade stainless steel needles, contain nickel (8.2%). So sensitivity to pigments can and does occur, even to iron oxides. The fact that organic colorants do not contain nickel is good. Organic pigments can cause allergic reactions too. Fortunately, this is rare. Most adverse effects come from sensitivity to antibiotic ointments applied after the permanent cosmetic procedure.</p>\r\n\r\n<p>In allergic reaction, the immune system starts fighting substances that are usually harmless.</p>\r\n\r\n<p>This overreaction can cause a rash, itchy eyes, a runny nose, trouble breathing, nausea, and diarrhea.</p>\r\n\r\n<p><strong>There are many types of allergies:</strong></p>\r\n\r\n<ul>\r\n	<li>Allergies to food</li>\r\n	<li>Allergies to medicine</li>\r\n	<li>Allergies to insect venom</li>\r\n	<li>Allergies to animals,</li>\r\n	<li>Allergies to natural rubber</li>\r\n	<li>Allergies to inhaled substance</li>\r\n	<li>Allergies to cosmetics</li>\r\n</ul>\r\n\r\n<p>Allergic reactions are sensitivities to substances that come into contact with the skin, nose, eyes, respiratory tract, and gastrointestinal tract.<br />\r\nAllergy skin test is always a good practice.</p>\r\n\r\n<p>According to FDA tattoo and permanent makeup &nbsp;&nbsp;</p>\r\n\r\n<p>Inorganic compounds are easily obtainable from natural sources (iron Oxide) However iron oxide fade and change color. Historically used mercury and cadmium salts and they are toxic.</p>\r\n\r\n<p>Organic pigments first synthesized in mid 1800s. Satisfied need for new pigments advantages of organic pigments. They are more intense color than inorganic pigments give wider range of color and are removable with laser techniques.</p>\r\n\r\n<p><strong>Organic Permanent Make up system (OPM) is the next generation of cosmetic tattooing:</strong></p>\r\n\r\n<p><span style="font-size:18px"><strong>I have been doing permanent make up for over 19 years, and I was frustrated with iron oxide pigments color changing 3-6 months post procedure.</strong></span> I saw clients are walking around with blue, red, or purple eyebrows. That&rsquo;s being said, the shape was good but the color wasn&rsquo;t, and it was a discouragement for these clients to tell others to do permanent make up. Who wants to walk around with colored eyebrows that look unnatural?</p>\r\n\r\n<p>Every time I used iron oxide pigments in the past, blood comes out and pigments don&rsquo;t stay in, so I would go over and over to insert the pigments in the skin and I came to discover that I caused further damage to the skin, and after 2 weeks of healing I lost about 40%-60% of the pigments.<br />\r\nI came also to find out that alcohol is an irritant to the skin and causes cell damage.</p>\r\n\r\n<p>A study that set out to test whether ethanol, of the kind used in cosmetics, caused apoptosis in human skin cells. It concluded that ethanol was toxic to cells in both a dose- and time-dependent manner and increased the percentage of cells undergoing apoptosis. The conclusion was that &ldquo;even at low concentrations, ethanol may induce apoptosis in skin cells&rdquo;.</p>\r\n\r\n<p>Soon later and after working closely with experts, I was able to design this unique and only US patent pigment (OPM) system. It is formulated for each skin type. It is water based and they are easy to insert in to the skin. OPM system is alcohol free, easy to use and there is no color changing.</p>\r\n\r\n<p><strong>Still confused about organic and inorganic, let&rsquo;s look at the facts:</strong></p>\r\n\r\n<ul>\r\n	<li>It is true and it is a fact that iron oxide based pigments change color after 3-6 month, and that&rsquo;s being said it lead potential clients to say I don&rsquo;t want to do permanent make up because my friend&rsquo;s eyebrows are blue, or red, etc&hellip;</li>\r\n	<li>OPM pigments are concentrated and they are water based and you don&rsquo;t need to reapply them so many times, just one pass and the pigment stay in the skin.</li>\r\n	<li>OPM system is unique in every aspect: concentrated pigments and gentle machine to insert our pigments with gentle penetration causing minimal or no bleeding or down time.</li>\r\n</ul>\r\n', 'faq', 'FAQ', 'What is Organic Permanent Makeup? Organic Semi-Permanent Make-up is a state of the art technique of applying organic pigments into the outer layer of the skin. A micro-needle power pen is used that is 100% safe. This causes no downtime, takes 20 to 40 minutes and lasts 2 to 5 years. Eyebrows : with OP make-up the eyebrows can mimic the appearance of hair in the brow line. Anyone who desires a more full hair like stroke will love this procedure and the time it will save them 24/7 . Those who apply pencil can now go swimming, go to the gym and wipe their forehead without the embarrassment of losing their eyebrows. Alopecia, Trichotilloma, post-chemo patients are always surprised at how natural it looks. Eyeliner: With OP make-up you may achieve a subtle, natural look, mimicking thousands of tiny eyelashes, achieving a lash enhancement look. The implantation of organic pigments on the lash line is very popular with both male and female clients. Additional shadowing of color can be added for a soft natural liner or a bold defined line may be achieved. Ophthalmologists recommend intradermal cosmetic procedures for those who are allergic to conventional make-up or those wearing contact lenses. Lip Liner: Op Make-Up procedures for lip color is beautiful! It can appear to change the size and shape of the lips as well as the color. This procedure helps prevent lipstick from bleeding into surrounding skin. A soft pink similar to the color of a newborn baby is popular for those wanting ', ''),
(4, 'OPM®CERTIFICATION', '<h2>The OPM&reg; WorkShop for Certification</h2>\r\n\r\n<p>A mandatory introduction to the world of organic permanent <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="a6db0fab-9996-4293-ba78-e898a7383b4f" id="9e0bfdd6-c63a-43b2-8137-891ea54f303a">make up</gs>, this is our best and most informative workshop ever. &nbsp;The workshop is a rapid and intense course of study, and an efficient way of learning all about Lorine&rsquo;s patented OPM&reg; Organic Permanent Makeup technique. This course will be available after each trade show event. To see a list of <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="b18b7c31-777b-4225-b17e-ed058c1c4c6b" id="91a4ef3d-ee52-4ff4-af0e-d0709d932373">location please</gs> click here.</p>\r\n\r\n<p>The price of each course is $995. To purchase this course package,&nbsp;click here.</p>\r\n\r\n<div class="col-sm-4"><img alt="" class="img-responsive" src="/upload/files/pages_images/certification_img1.png" style="height:170px; width:231px" /></div>\r\n\r\n<div class="col-sm-4"><img alt="" class="img-responsive" src="/upload/files/pages_images/certification_img2.png" style="height:170px; width:246px" /></div>\r\n\r\n<div class="col-sm-4"><img alt="" class="img-responsive" src="/upload/files/pages_images/certification_img3.png" style="height:170px; width:221px" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<p><strong><span style="color:#64ad33">The price of each course is $995. To purchase this course package,&nbsp;</span><a href="#"><span style="color:#64ad33">click here</span></a></strong>.</p>\r\n\r\n<hr />\r\n<h2>OPM&reg;CERTIFICATION</h2>\r\n\r\n<div>\r\n<p>All of our OPM certification <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="65e33019-bce1-4d1a-a025-f373bc5192f7" id="b85c0d54-bd81-4dd9-a6d3-6e2f2fe746a6">class</gs> there is a 2 week Training online where you will Perfect your skill on the drawing and pigmentation Technique you must practice 100 hours to do a good job on the drawing. This time is important for you to practice after you finish you need to send us your work. Before you work on models. You&nbsp;must buy our training kit to start our program. The Training kit includes:&nbsp;OPM machine, 5 skins, measuring tool, white pen, workbook online video and print out practice sheet. $2500</p>\r\n\r\n<p style="margin-left:40px">1) Upgrade to OPM advance system Training with this class there is a 2 week practice online, and hands on training for 3 days. This class is great for those that are doing permanent makeup, but wants to prefect their skills and upgrade to OPM &nbsp;system<gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="1877da3e-afbd-434b-b37f-b2bbafce3813" id="08bd66b3-be9a-4109-8b0b-06ad651562cc"> .</gs> $1995&nbsp;<br />\r\n2) OPM begging class &nbsp;If you never did permanent make up before you must sign up for our 6 days Training. Our 6 days training is $2,995 &nbsp;<br />\r\n3) OPM medical class, 3 days hands on must complete OPM class <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="11071931-2e25-4fb3-8882-b82d79f605f8" id="ac47aa02-f62c-4f28-b0f8-3c933cda3ebd">beginner</gs> or advance in this class we will teach you areola, scalp, scar, removal and correction. $2995<br />\r\n4) OPM 2 days scalp pigmentation class, this is only for scalp pigmentation, no need any other class. $1995<br />\r\n5) An internship program, this is a 4 month program where we master you in all permanent makeup procedure, $60,000 class guarantee to earn over a $3500-$5500/ month.&nbsp;</p>\r\n</div>\r\n\r\n<div class="g-clear_fix">\r\n<p>An internship can also be for free if you sign a contract to work for OPM for 2 years with 20% pay 1 year, 30% <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="c3c6c714-f845-4d0f-9fad-97c0ad87862a" id="79a6947c-006b-4894-a4d5-b9e62c926ae8">second year</gs> after your 4 month Training or 50 procedure to be <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="c3c6c714-f845-4d0f-9fad-97c0ad87862a" id="3d7838be-849d-4f07-a85d-515c0b522c58">complete</gs> your internship program. You must provide all your models. You will also learn how to operate and run an OPM location.</p>\r\n\r\n<p style="margin-left:40px"><strong><span style="color:#008000">Our system work as fallow&nbsp;</span></strong></p>\r\n\r\n<p style="margin-left:40px">After completion of our OPM certification, you are a joiner artist, to continue your growth with OPM we ask that you grow as fallow &nbsp;<br />\r\nComplete 30 procedures you are a senior artist&nbsp;<br />\r\nComplete 50 procedure you are a master artist&nbsp;<br />\r\nComplete a 100 procedure you can be a master trainer for OPM. With all procedures you must provide before and after photos and consent&nbsp;forms for all clients.&nbsp;<br />\r\n&nbsp;<br />\r\n<strong><span style="color:#008000">Sign up today for your Training</span></strong>&nbsp;</p>\r\n\r\n<p style="margin-left:40px"><gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="bc3bb015-2c44-4cd1-9715-b17d2bf34827" id="2884d4c4-a1bb-4a24-82a4-bc96e8d8522b">Opm</gs> 3 days advance dates&nbsp;<br />\r\n<gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="ce59910d-0ffe-4886-bf86-3cb778f60bd7" id="17d459c9-5815-4a2f-a557-2db6956a7d3d">Opm</gs> 6 days beginner dates&nbsp;<br />\r\n<gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="dff171c0-9fa4-4aa0-893b-e79e76a76fbd" id="3d822c53-06e0-43f0-ae9e-7a218039b948">Opm</gs> 3 days medical <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="dff171c0-9fa4-4aa0-893b-e79e76a76fbd" id="201b762d-9107-4436-a865-d0a13e085f4e">dates</gs>&nbsp;<br />\r\n<gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="3bdc5e79-8a4a-4a85-ae24-003d08a775bc" id="b46f263b-3a83-41b6-b9a8-542face4a1c5">Opm</gs> 2 days scalp pigmentation&nbsp;</p>\r\n\r\n<p><strong><span style="color:#008000">Interesting in our OPM system <a href="http://th.365-solutions.com/site/quick/3">sign in</a> now and will email you our OPM system overview video.</span></strong></p>\r\n</div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>OPM Partnership</h2>\r\n\r\n<p><strong>How Organic Permanent Makeup (OPM&reg;) Partnership works</strong></p>\r\n\r\n<p>We are looking for the right partners to open up OPM&reg; locations Nationwide.</p>\r\n\r\n<p>Our exclusive OPM&reg; Organic Permanent Makeup System uses state-of-the-art equipment, and the highest quality Derma Blush&reg; organic pigments that are formulated for each specific skin type. The Only US PATENT Formula.</p>\r\n\r\n<p>The results are safer and more natural than conventional permanent makeup.&nbsp;</p>\r\n\r\n<p>The OPM&reg;&nbsp; state-of-the-art machine that is made in Germany is designed to penetrate only in the <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="8390f68e-cb78-46c2-9d1d-503537e695c8" id="cc928581-b0cb-4baa-b86b-563f41a301e0">epidermal</gs> to create precision hairlike strokes for <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="8390f68e-cb78-46c2-9d1d-503537e695c8" id="12b7e656-cec1-4add-855a-304e463cdb74">natural flawless</gs> looking eyebrows, fine lash liner&nbsp; and fuller beautiful lips; without much pain and bleeding.&nbsp;</p>\r\n\r\n<p>Our OPM&reg; eraser can eliminate unwanted pigments for permanent makeup correction &amp; removal; makes our OPM&reg; system the next generation of permanent makeup.</p>\r\n\r\n<p>Our <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="8c3840a5-3f66-44dc-a361-fc0d33da47fb" id="45294939-7052-4c17-8f4b-b9022188415d">certified guaranteed</gs> training will give you the <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="8c3840a5-3f66-44dc-a361-fc0d33da47fb" id="cbf0a190-6d7f-4fc9-80ff-7d1d2dc3909e">confident</gs> and ability to run your own company and be a successful business owner.</p>\r\n\r\n<div class="col-sm-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/certification_img4.jpg" style="height:230px; width:334px" /></div>\r\n\r\n<div class="col-sm-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/certification_img5.jpg" style="height:230px; width:347px" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<hr />\r\n<h2>Your Investment&nbsp;</h2>\r\n\r\n<p><strong>$95,000 investment required</strong></p>\r\n\r\n<p>Financing can be available.</p>\r\n\r\n<p><strong>This includes:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Business <gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="bfaa57e9-bd57-458f-ac72-01d3bfecf560" id="f040ebdd-b5e5-4fbb-878f-644acdf92ef4">Set up</gs> = $35,000</strong></li>\r\n	<li>Location set up (minimum 850 square feet) that includes 4 to 5 treatment rooms and 1 consultation room</li>\r\n	<li>Includes Lease for 3 months</li>\r\n	<li>Location Construction</li>\r\n	<li>Includes Equipment, Supplies, Furniture</li>\r\n	<li>POS System</li>\r\n	<li>Permanent Makeup Liability Insurance</li>\r\n	<li>Licensing</li>\r\n	<li>Marketing Materials</li>\r\n	<li><gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="7a96816b-b335-4a10-9981-f4717b5402eb" id="8bf5ed83-38c5-46d7-a8b0-863c23275f53">Website</gs></li>\r\n	<li>Back Off Support</li>\r\n	<li>Client Scheduling Software</li>\r\n	<li>Sales Training</li>\r\n	<li>Business Training</li>\r\n	<li>Inventory Training Management</li>\r\n	<li>On-going business support for 1 year.</li>\r\n	<li><strong>Training by Lorine Mikheail (Founder of Organic Permanent Makeup (OPM&reg;<gs class="GINGER_SOFTWARE_mark" ginger_software_uiphraseguid="d1df193c-1e40-4bd4-b1b5-5ebfa6cab4de" id="86b0a364-ea32-47af-a364-6dae38a4973e">)</gs>= $60.000</strong></li>\r\n	<li>3&nbsp;months training of makeup artistry</li>\r\n	<li>Eyebrows, eyeliner, and lips, techniques</li>\r\n	<li>Scalp pigmentation techniques</li>\r\n	<li>Permanent makeup correction and removal techniques</li>\r\n	<li>Areola restoration and scar camouflag