rkShop for Certification A mandatory introduction to the world of organic permanent make up, this is our best and most informative workshop ever.  The workshop is a rapid and intense course of study, and an efficient way of learning all about Lorine’s patented OPM® Organic Permanent Makeup technique. This course will be available after each trade show event. To see a list of location please click here. The price of each course is $995. To purchase this course package, click here.   The price of each course is $995. To purchase this course package, click here. Next Classes for OPM®CERTIFICATION March 9-11, 2014 IBS New York- The International Beauty Show Jacob K. Javits Convention Center 655 W. 34th St. New York, NY 10001 Booth #1362 Certification Class on March 12, 2014 March 22-24, 2014 Americas Beauty Show McCormick Place 2301 S. Lake Shore Dr. Chicago, IL 60616 Booth #1511 Certification Class on March 25, 2014 OPM Partnership How Organic Permanent Makeup (OPM®) Partnership works We are looking for the right partners to open up OPM® locations Nationwide. Our exclusive OPM® Organic Permanent Makeup System uses state-of-the-art equipment, and the highest quality Derma Blush® organic pigments that are formulated for each specific skin type. The Only US PATENT Formula. The results are safer and more natural than conventional permanent makeup.  The OPM®  state-of-the-art machine that is made in Germany is designed to penetrate only in the epidermal to create precision', ''),
