" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-scalp-pigmentation-4.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<h2>Permanent Makeup and Tattoo Correction / Removal</h2>\r\n\r\n<div class="col-xs-12"><img alt="" class="img-responsive" src="/upload/files/pages_images/Permanent-Makeup-Removal-Permanent-Makeup.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<h2>Areola Restoration</h2>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/areola-restoration-1.jpg" /></div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/areola-restoration-2.jpg" /></div>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<div class="col-xs-6"><img alt="" class="img-responsive" src="/upload/files/pages_images/areola-restoration-3.jpg" /></div>\r\n', 'gallery', 'Gallery', '', ''),
