(8, ' OPM Partnership', '<h2>How Organic Permanent Makeup (OPM&reg;) Partnership works:</h2>\r\n\r\n<p>We are looking for the right partners to open up OPM&reg; locations Nationwide.</p>\r\n\r\n<p>Our exclusive OPM&reg; Organic Permanent Makeup System uses state-of-the-art equipment, and the highest quality Derma Blush&reg; organic pigments that are formulated for each specific skin type. The Only US PATENT Formula.</p>\r\n\r\n<p>The results are safer and more natural than conventional permanent makeup.&nbsp;</p>\r\n\r\n<p>The OPM&reg;&nbsp; state-of-the-art machine that is made in Germany is designed to penetrate only in the epidermal to create precision hairlike strokes for natural flawless looking eyebrows, fine lash liner&nbsp; and fuller beautiful lips; without much pain and bleeding.&nbsp;</p>\r\n\r\n<p>Our OPM&reg; eraser can eliminate unwanted pigments for permanent makeup correction &amp; removal; makes our OPM&reg; system the next generation of permanent makeup.</p>\r\n\r\n<p>Our certified guaranteed training will give you the confident and ability to run your own company and be a successful business owner.</p>\r\n\r\n<h2>Your Investment:&nbsp;</h2>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-partnership-1.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>$95,000 investment required.</p>\r\n\r\n<p><em><strong>Financing can be available.</strong></em></p>\r\n\r\n<p>This includes:</p>\r\n\r\n<h2>Business Set up = $35,000</h2>\r\n\r\n<p>Location set up (minimum 850 square feet) that includes 4 to 5 treatment rooms and 1 consultation room</p>\r\n\r\n<div class="g-clear_fix">&nbsp;</div>\r\n\r\n<p><img alt="" class="img-responsive" src="/upload/files/pages_images/opm-partnership-2.jpg" style="float:right; margin:0px 0px 0px 50px" /></p>\r\n\r\n<p>Includes Lease for 3 months<br />\r\nLocation Construction<br />\r\nIncludes Equipments, Supplies, Furnitures.<br />\r\nPOS System<br />\r\nPermanent Makeup Liability Insuranceb07135cc53957780b4cbb115dcc8cb19<br />\r\nLicensing<br />\r\nMarketing Materials<br />\r\nWebsite<br />\r\nBack Off Support<br />\r\nClient Scheduling Software<br />\r\nSales Training<br />\r\nBusiness Training<br />\r\nInventory Training Management<br />\r\nOn-going business support for 1 year.</p>\r\n\r\n<h2>Training by Lorine Mikheail (Founder of Organic Permanent Makeup (OPM&reg;)= $60.000</h2>\r\n\r\n<p>3 months training of makeup artistry Eyebrows, eyeliner, and lips, techniques Scalp pigmentation techniques Permanent makeup correction and removal techniques Areola restoration and scar camouflage techniques</p>\r\n\r\n<p>2014 Will be Opening in<br />\r\nOrange County, CA<br />\r\nStudio City, CA<br />\r\nWestwood, CA</p>\r\n\r\n<hr />\r\n<p><span style="font-size:11px">To Apply to Own send Email to:<br/>\r\n\r\nop@opmakeup.com<br/>\r\n\r\nMake sure to include:</span></p>\r\n\r\n<p><span style="color:#308083"><span style="font-size:10px">Your resume<br/>\r\n\r\nCover letter explaining why you would like to form partnership with Organic Permanent Makeup (OPM&reg;) and your financing option. Thank you!</span></span></p>\r\n', 'opm-partnership', ' OPM Partnership', '', '');

